<?php
	
	define('UPLOAD_DIR', 'images/');
	$img = $_POST['imgDataURL'];
	$hidid = $_POST['hidid'];
	$imgid = $_POST['imgid'];
	$cursrc = $_POST['cursrc'];
	//$img = 'data:image/jpeg;base64,';
	
	
	
	if (preg_match('/.*(-D)+.jpeg/',$cursrc)){
		unlink($cursrc);
	}
	
	$cursrc = preg_replace('/\.jpeg|\.jpg/','',$cursrc);
	$filename = $cursrc . "-D.jpeg";
	$img = str_replace('data:image/jpeg;base64,', '', $img);
	$img = str_replace(' ', '+', $img);
	$data = base64_decode($img);
	//$file = UPLOAD_DIR . uniqid($prefix) . '.jpeg';
	$file = $filename ; 
	$success = file_put_contents($file, $data);
	//print $success ? $file : 'error';
	if($success){
		echo $file;
	}
	//create and check connection
	$servername = "localhost";
	$username = "root";
	$password = "root";
	$dbname = "odes";

	$conn = new mysqli($servername, $username, $password, $dbname);

	if ($conn->connect_error) {
		die("Connection failed: " . $conn->connect_error);
	}
	
	//update imgpath in db 
	$conn->query("UPDATE `ansscripts` SET `ImagePath`='{$file}' WHERE `HidId`='{$hidid}' AND `ImgId`='{$imgid}'");
	
	$conn->close();

	
?>
